	@include vue-flex;
	align-items: center;
	justify-content: center;
	height: 100%;
}
.content {
	text-align: center;
}
.dz-flower {
	@include vue-flex;
	align-items: center;
	justify-content: center;
	// padding: 30rpx 0;
	width: 120rpx;
	height: 120rpx;
	background: rgba(17, 17, 17, 0.7);
	border-radius: 20rpx;
}
.tip {
	padding: 10rpx 20rpx;
	font-size: 22rpx;
	text-align: center;
	color: #999;
}
.back {
	padding: 10rpx 20rpx;
	font-size: 22rpx;
	text-align: center;
	color: #2979ff;
}
</style>
